    public class BomShoppingDBInitializer : DropCreateDatabaseAlways<BomShoppingContext>
    {
        protected override void Seed(BomShoppingContext context)
        {
            try { 
                GetPurposes(context).ForEach(p => context.Purposes.Add(p));
                context.SaveChanges();
                GetCategories(context).ForEach(c => context.Categories.Add(c));
                context.SaveChanges();
                GetRanks(context).ForEach(r => context.Ranks.Add(r));
                context.SaveChanges();
                GetPLItems(context).ForEach(i => context.PricelistItems.Add(i));
                context.SaveChanges();
                GetTemplates(context).ForEach(t => context.Templates.Add(t));
                context.SaveChanges();
                //LinkItemsToTemplates(context);
                //context.SaveChanges();
                GetBundles(context).ForEach(b => context.Bundles.Add(b));
                context.SaveChanges();
                GetQnA(context).ForEach(q => context.QuestionsAndAnswers.Add(q));
                context.SaveChanges();
                GetContact(context).ForEach(c => context.Contacts.Add(c));
                context.SaveChanges();
                GetNews(context).ForEach(n => context.News.Add(n));
                context.SaveChanges();
            }
            catch (System.Data.Entity.Validation.DbEntityValidationException dbEx)
            {
                Exception raise = dbEx;
                foreach (var validationErrors in dbEx.EntityValidationErrors)
                {
                    foreach (var validationError in validationErrors.ValidationErrors)
                    {
                        string message = string.Format("{0}:{1}",
                            validationErrors.Entry.Entity.ToString(),
                            validationError.ErrorMessage);
                        // raise a new exception nesting
                        // the current instance as InnerException
                        raise = new InvalidOperationException(message, raise);
                    }
                }
                throw raise;
            }
        }

